Information
------------------------------

On the evening of October 17, 1989 - as the first pitch was about to be thrown in the third game of the World Series - disaster struck as the world watched live. It was the most powerful earthquake the Bay Area had seen since the one that devastated San Francisco in 1906. In a CNN Special Report San Francisco Shaken: 25 Years Since the Quake, CNN's Randi Kaye reports on the aftershocks - of the emotional kind - that can still be felt decades later. (2014)

